"title": "Whatever I design, CAPS, BACKPACKS, or BAGS, I love to use my imagination to create custom orders!  ",
"announcement": "WELCOME TO MY SHOP.  I have had a lot of fun customizing orders for people over the past few  years.   \n\nMy son is a welder and I started making welding caps for him and his co-workers.  My most requested item is the reversible  &quot;CROWN ROYAL&quot; welding cap.  I use the liquor bags themselves, cut them apart and design each cap on an individual basis.  They are all UNIQUE!  I try and keep many colors in stock.  Presently, I have black, green, maple brown, purple, and camoflauge purple. I also design caps with various novelty themes, as requested.  My most requested novelty fabrics use pin up girls, guns, beer panels, and marvel comics.  Remember  these caps are reversible, so have an idea what you would like shown on the flip side. Most  caps are personalized per customer request  giving you a one of a kind purchase.   Feel free to message me with any ideas you may have and let&#39;s see what unique item can be constructed between us!  \n\nFor the women, I construct totes, messenger bags, and shoulder bags..  Both of my daughters are nurses, giving me added incentive in creating items using the nursing themed fabrics.  I have  purchased quite a few different novelty fabrics for this line.\n\nFor the kids, I have backpacks for purchase and love to customize the fabrics for these too.  If you have a certain theme in mind, send me a message and we will fabric search to find material to your liking, .\n\nI have fallen in love with repurposing furniture for purchase within the area I live in.  I wish shipping wasn&#39;t an issue because I would love to list them also, but there is no  plan of this happening in the immediate future.    \n\nCome and browse my shop at any time and ask me about ordering something specifically wanted by you.  We will see what we can come up with.\n \nThank you for stopping by.",
