"description": "&gt;&gt; SALE! Buy 3, 4th is FREE! &lt;&lt;\nUse COUPON CODE: BOOOTEE when you buy 3 shirts to get the 4th FREE! \n(Add 4 shirts to your cart and apply code!)\n\nABOUT OUR TEES AND INK:\nWe strive to print on some of the softest shirts around, while keeping our prices low. We believe that even novelty shirts deserve to be comfortable! Our charcoal is a polyblend and contains polyester for an even softer feel.\n\nOur tees are a medium-weight, meaning they aren&#39;t a heavy cotton, nor a thin fabric. We find that a medium-weight is more durable than light cotton, while also allowing skin to breathe for a comfortable fit. All of our shirts are pre-shrunk and feature a tear-away label. We adhere a hangtag to each garment with our cute little ghost mascot (we do not include price tags). Most of our tees are 100% ringspun cotton, several of our heathered shirts are polyblends. Please read below about our sizing and the cut of our tees.\n\nAll of our designs are available for print on Mens/Unisex, Ladies, Maternity, Youth, Toddler, and Infant garments. Please message us if you do not see the cut of shirt you&#39;d like in the drop-down.\n\nOur inks are water-based and non-toxic. Our environmentally-friendly inks last for countless washes with no cracking, peeling, or fading!\n\nTEE SIZING:\nPlease refer to this listing&#39;s photos for our size chart, see below for other sizes. If you are able, we recommend taking a quick measurement of an existing tee before ordering to ensure the garment will fit. I recommend comparing the measurements to tee that has gone through the wash that has a comfortable fit :)\n\nWhen measuring, please lie the t-shirt on a flat surface, and 1&quot; down from the armpit, measure across to achieve the chest size/width. For length, measure from next to the collar to the bottom seam of the shirt.\nâ–„â–„â–„â–„â–„â–„â–„â–„â–„â–„â–„â–„â–„â–„â–„â–„â–„â–„â–„â–„\nADULT SIZES:\nRefer to the photo in the listing for specifications.\n*UNISEX/MENS are true to size as per most of our customers and the brand that manufacturers it. Please measure if unsure.\n*LADIES are side-seamed for a more feminine, form-fitting cut, featuring a thinner collar and wider neck than our unisex/mens fit, which is looser fitting. If it is for yourself, we recommend measuring beforehand to get an idea of how it may fit on you. If you are unsure of sizing or prefer a looser fit, we recommend possibly going up a size.\nâ–„â–„â–„â–„â–„â–„â–„â–„â–„â–„â–„â–„â–„â–„â–„â–„â–„â–„â–„â–„\nMATERNITY SIZES:\n*Maternity sizes are true to size, with come customers saying they run larger.\nSMALL chest: 18&quot;\nMEDIUM chest: 19&quot;\nLARGE chest: 21&quot;\nXL chest: 23&quot;\n2XL chest: 24&quot;\nâ–„â–„â–„â–„â–„â–„â–„â–„â–„â–„â–„â–„â–„â–„â–„â–„â–„â–„â–„â–„\nCHILDREN&#39;S SIZES (see below):\n\nYOUTH FIT TEE:\nS : 22&quot; length x 17&quot; chest (approx. size 6-8)\nM: 23.5&quot; length x 18&quot; chest (approx. size 10-12)\nL: 25&quot; length x 19&quot; chest (approx. size 14-16)\nâ–„â–„â–„â–„â–„â–„â–„â–„â–„â–„â–„â–„â–„â–„â–„â–„â–„â–„â–„â–„\nTODDLER FIT TEE\n*Toddler tees are true to size and are unisex. We do not recommend going up a size. For example, 2T is the best fit for a two year on average.\nBODY WIDTH X FULL BODY LENGTH (in inches)\n2T: 13X15.5\n3T: 14X16.5\n4T: 15X17.5\n5/6T: 16X18.5\n\nWASH INSTRUCTIONS:\nThey are preshrunk, however even preshrunk garments can shrink if not washed according to the manufacturer&#39;s instructions on the tag. We recommend washing on cold and tumble-drying low for best results.\n\nTEE & INK COLOR:\nIf there is a t-shirt size or color you need that is not listed, please send me a message! We can also print on American Apparel Mens/Unisex and Ladies t-shirts, please message us or send us a Custom Order Request for this option.\n\nPlease refer to the T-shirt Color Chart in the listings photos to see what ink (white or black) will be printed on the tee color you selected. If youâ€™d like an ink color that is not shown, please let me know and we will try to accommodate that :)\n\nCUSTOM DESIGNS:\nWe can print your own custom designs. Please send us a Custom Order Request! Customs are also still eligible for our Buy 3, get the 4th free. A extra fees may be charged to design the shirt. We provide a mockup upon request after purchase.\n\n\nSHIPPING:\nPLEASE CHECK OUR SHIPPING POLICIES FOR OUR CURRENT PROCESSING SPEED! It may vary around those busier holidays :)\n\nAll items ship from the United States and come with USPS tracking information. It is the customer&#39;s responsibility to monitor tracking and to contact USPS for issues with addresses or delays in transit.\n\nUSA: Shipping within the US typically takes about 2-5 business days to arrive once shipped depending on your location. If you order 3 or more items, your shipping is upgraded to Priority Mail and will arrive in 1-3 business days once shipped.\n\nCANADA: Once shipped typically takes 5-14 BUSINESS DAYS OR LESS.\n\nINTERNATIONAL : Once shipped typically takes 5-21 BUSINESS DAYS OR MORE DEPENDING ON YOUR COUNTRY. Please check your country&#39;s custom regulations as delays or additional fees to the customer may be incurred based on customs policies. We are not responsible for fees that are incurred in customs and are unable to predict any fees that you may encounter, please check with your country&#39;s customs regarding these fees before purchasing if there is concern. \nSome countries may not agree to continue with tracking scans for USPS to keep tracking available, so tracking information may end once it leaves the US if your country has such policies.\nâ–„â–„â–„â–„â–„â–„â–„â–„â–„â–„â–„â–„â–„â–„â–„â–„â–„â–„â–„â–„\n\n\nRETURNS AND EXCHANGES:\nWe do understand it can be a challenge to find the perfect size online without being able to try it on before purchase, especially with variations in sizing across thousands of brands. If you need a change in size or color, please message me within 7 days of receiving your order and let me know. We will ask you to ship the item back to us and then we will happily ship out the replacement free of charge :)\nIf you&#39;d like a refund, we will ask you to ship the item back to us and we will promptly refund for the cost of the t-shirt upon receipt :)\n\nTHANK YOU for supporting us and small businesses like ours!",
