"announcement": "&gt;&gt;SALE!&lt;&lt;  Buy 3, 4th is FREE, see coupon codes and FAQ below!\r\nOur current processing speed is approx. 2-3 business days (BEFORE shipment) depending on our current volume of orders. \r\nA portion of all dog and cat related tees sales are donated to support local shelters in metro Philadelphia and surrounding counties  =^.^=\r\n------------------------------------------------------\r\nS H I P P I N G:\r\nAll orders come with USPS TRACKING information. Once shipped out, items take approximately 2-5 business days to arrive within the US. If you order 3 or more items, your shipping is upgraded to Priority Mail and will arrive in approx. 1-3 days once shipped. \r\nThese delivery times do not include processing speed since all of our items are made to order :) Please read our shipping policies to learn about international shipping times.\r\n----------------------------------------------------\r\nC U S T O M I Z A T I O N:\r\nIf you need any shirts customized, please send us a message and we will be happy to create a custom order just for you! We will provide a mockup/proof upon request AFTER ordering before we go to print. \r\n\r\nOur buy 3, 4th free discount is available for all items, including custom orders. Additional fees apply for custom designs. If you&#39;re shipping a gift and you&#39;d like to add a note with your package, just add it in the Notes to Seller, we can accommodate that at no additional cost :)\r\n------------------------------------------------------\r\nOUR TEES & INK\r\nPlease read the item&#39;s description to learn more about our t-shirts, our ink, and our sizing.\r\nAll of our designs are also available in youth, toddler, and infant sizes.\r\n\r\nTHANK YOU for supporting small businesses like ours and happy shopping! :)\r\n\r\n------------------------------------------------------\r\nC O U P O N - C O D E S:\r\nUse COUPON CODE: BOOOTEE when you buy 3 shirts to get the 4th FREE! (Add 4 shirts to your cart and apply code!)\r\n\r\nUse COUPON CODE: 2FREE when you buy 6 shirts to get the 7th and 8th FREE!\r\n(Add 8 shirts to your cart and apply code!)\r\n\r\nUse COUPON CODE: THREEFREE when you buy 9 shirts to get the 10th, 11th, and 12th FREE! (Add 12 shirts to your cart and apply code!)",
