"vacation_message": null,
"sale_message": "Hi! Thank you for your order! Our current processing speed (BEFORE shipping out) is approx. 2-3 business days depending on our current volume of orders (higher around holidays). \r\n\r\nIf you&#39;d like your order sooner, we do recommend upgrading your shipping speed checkout. Please message us if you&#39;d like to upgrade to expedited shipping after ordering, such as Priority or Express Mail. \r\n\r\nAll orders are processed in the order they are received and will ship out within 2-3 business days (does not include weekends/holidays). Please add an extra day for custom-made orders that require graphic designing or orders with 3 or more items. \r\n\r\nTracking will be provided upon shipment. We can not guarantee specific delivery dates (as much as we&#39;d like to!) Since once it is given to USPS, it is subject to their delivery times and occasional delays (weather, etc) which are completely out of our control :( So please plan accordingly! Please ensure the shipping address is correct, we are not responsible for items lost due to incorrect addresses.\r\n\r\nFor international orders and more shipping information, please refer to our shipping policies. \r\n\r\nFor any urgent, special instructions with your order, please message me directly via Etsy (not email preferably, as I don&#39;t check it as often) as I sometimes don&#39;t see the Notes to Seller on the receipt until I go to work on your order :)\r\n\r\nBe sure to let me know asap if there is any issue with your order after receiving, ALL problems have swift resolutions!\r\n\r\nJust send me a message if you have any questions, I typically respond within the hour!\r\n\r\nThank you for supporting small family businesses like ours!\r\n",
