"policy_additional": "DO YOU ACCEPT CUSTOM ORDERS?\nWe gladly accept custom orders. Additional fees apply and custom orders do qualify for our buy 3, 4th free sale. We can forward a mockup upon request after purchase before printing for any adjustments. \nDue to the nature of custom orders we can not accept refunds or exchanges, but if you need any help determining sizing before purchasing, just send us a message and we will be happy to help! :)\n\nHOW DO THE SIZES RUN?\nOur MENS/UNISEX tees are true to size as per the brand and our customers, though some customers have said they felt the medium ran smaller.\n\nOur LADIES tees are true to size as per the brand, however, some customers have said they felt the ladies small ran smaller. Measuring will give the best idea, but if you are unsure or prefer a looser fit, going up a size may be recommended :)\n\nOur TODDLER tees are unisex. We do not recommend going up a size. For example a 2T is the best fit for a two year old on average.\n\nSize charts and other helpful sizing information are found in the photos and description for each listing. Do message us if you&#39;d like help with sizing or would like additional photos of our tees on models.\n\nCOUPON CODES!\nUse COUPON CODE: BOOOTEE when you buy 3 shirts to get the 4th FREE! (Add 4 shirts to your cart and apply code!)\n\nUse COUPON CODE: 2FREE when you buy 6 shirts to get the 7th and 8th FREE!\n(Add 8 shirts to your cart and apply code!)\n\nUse COUPON CODE: THREEFREE when you buy 9 shirts to get the 10th, 11th, and 12th FREE! (Add 12 shirts to your cart and apply code!)\n\nPURCHASING 6 OR MORE ITEMS?\nWe combine shipping costs, which are calculated at checkout. Please message us with your general location if you plan to purchase 6 or more items, we can calculate shipping costs for that weight and location and reduce your shipping fees.\n\nI NEED MY ORDER ASAP!\nWe recommend selecting Priority Mail at checkout. For Express Mail or expedited International options, just send us a message :)\n\nWe can NOT GUARANTEE DELIVERY DATES (as much as we would like to!) since once it is in USPS care it is subject to their delivery times, which vary greatly by location and various other delay factors (weather, etc) which are completely out of our control :( So please plan accordingly!",
