"announcement": "Hi lovely people! Could you please take a moment to check the shipping time frames before ordering. Also please keep in mind it takes 3-5 business days for me to make your item! Thank you :)",
"currency_code": "GBP",
"is_vacation": false,
"vacation_message": "Gday guys\r\n\r\nWe&#39;re off to a Australia for a few weeks, we are still able to take questions if you have any enquires please feel free to ask. \r\nOrders already taken will be processed and sent before the allocated time.\r\n\r\nWe will be opening back up on the 14 may with new stock and new items. \r\n\r\nCheers\r\nGreg",
"sale_message": "Thank you for purchasing your item from Whiskey Wood Craft. I will get busy making your piece,this can take up to 5 business days.\n\n Once it has been crafted and posted we will send you a notification letting you know it&#39;s on it&#39;s way! \n\n***Please note we will not provide a tracking number unless you upgraded the shipping.***\n\nPlease take the time to check out the estimated shipping times to your country and allow this to time to pass before contacting me if your item has not yet arrived.\n\n Kind regards,Greg.",
"digital_sale_message": null,
"last_updated_tsz": 1476537853,
