"accepts_custom_requests": true,
"policy_welcome": "G&#39;day guys and welcome to our Whiskey Wood Craft page. I make all our items completely by hand and from authentic Irish Whiskey Barrels. I hope you enjoy our items. Any questions please don&#39;t hesitate to ask me.\r\n\r\nCheers\r\nGreg",
"policy_payment": "INTERNATIONAL CUSTOMERS- please note that government fees, duties, taxes,customs, royal mail fees, etc. are your responsibility",
"policy_shipping": "Items will be shipped within 3-5 business days after purchase.\r\n\r\nWe post all our items with Royal Mail Standard Shipping which DO NOT HAVE A TRACKING NUMBER. \r\n\r\nUK - Standard second class post should take 3 business days\r\n\r\nUSA and Canada- Standard shipping should take 9-11 business days\r\n\r\nAustralia, South America and Non EU- Standard shipping take 9-15 business days\r\n\r\nEU- Standard Shipping 3-7 business days\r\n\r\nThe standard shipping does not come with a tracking number if you want one you need to upgrade to the International Tracked and Signed shipping this can be done at checkout by clicking on the shipping upgrade options and WILL cost extra. This will allow you to track your parcel.\r\n\r\nSometimes your item may be delayed due to unforeseen circumstances, bad weather or delayed in customs so please be patient. If it still has not arrived a few days after its due, please contact me and I will do everything I can to resolve this.",
"policy_refunds": "CANELLATIONS\r\n\r\nIf you wish to cancel your order you must tell us immediately within 24 hours from ordering before I start to make them. \r\n\r\nUnfortunately if I have already posted the item you will not be able to get a refund as I have already completed the order for you and they are on their way,\r\n\r\nFAULTY/BROKEN ITEMS\r\n\r\nIf you are unhappy with the item you receive or it has arrived damaged please contact  us immediately and we will be happy to replace or refund the item .(minus the cost of shipping costs). Refunds or returns MUST be within 28 days of purchase. \r\n\r\nIn the rare instance if your item is damaged or lost, I will gladly make an insurance claim to try and recover costs\r\n\r\n Please keep all original packaging and receipts as this will help when trying to resolve a claim with the courier. As soon as the issue has been resolved and verified by the courier I will issue a full refund or replacement immediately.\r\n\r\nIF YOUR ITEM DOES NOT ARRIVE,YOU MUST NOTIFY ME WITHIN 28 DAYS OF ME POSTING OR I WILL NOT BE ABLE TO ISSUE A REFUND OR REPLACEMENT!",
"policy_additional": "CUSTOM ORDERS - we love to hear from our customers with new ideas or something you would like us to do with our barrels. Please contact us and we would love to work with you and help turn your ideas into reality.\r\n\r\nMULTIPLE ORDERS- If you wish to make an order for multiple pieces please contact us for pricing and postage costs before purchasing",
