"policy_additional": "CUSTOM ORDERS - we love to hear from our customers with new ideas or something you would like us to do with our barrels. Please contact us and we would love to work with you and help turn your ideas into reality.\r\n\r\nMULTIPLE ORDERS- If you wish to make an order for multiple pieces please contact us for pricing and postage costs before purchasing",
