"policy_shipping": "*****Our current shipping schedule is 7-10 business days.*****\r\nThere is a 2-3 day transit time in the US. IF you need your flasks\r\nsooner, PLEASE contact me before purchasing.\r\n\r\n****INSIDE THE US****\r\nWe ship via USPS Priority Mail. A tracking number is provided through Etsy after shipping.\r\n\r\n****OUTSIDE THE US****\r\nFor single unit orders, we ship via 1st class USPS. For multiple item orders, your package(s) is shipped via USPS Priority Mail. A tracking number is provided in either case after shipping.\r\n\r\n****SHIPPING UPGRADES****\r\nAll of our products are created to order. We do not offer shipping upgrades due to the &quot;scheduled shipping schedule&quot; confusion it creates. Within the US in most cases, your order will arrive within 2 weeks of purchasing. Please check above for our current shipping schedule!",
"policy_refunds": "Because our products are custom made and personalized, we consider all sales final.\r\n****DAMAGE or LOST IN TRANSIT****\r\nIf you experience damage or your package is lost in transit, we&#39;ll replace the items asap. If &quot;lost in transit&quot; or the tracking shows &quot;delivered&quot;, we do require a different shipping address before shipping the replacements.",
"policy_additional": "All of our items can be personalized for no additional costs!\r\n\r\n**ABOUT OUR FLASKS & GLASSWARE**\r\nOur designs are PRINTED on vinyl. They are NOT engraved, etched, burned or painted. PLEASE read the listings. If you have any questions, please contact me!",
