"announcement": "*Let&#39;s Get Decorative is no longer accepting new orders needed by or before 10/22*\r\nCurrent shipping time is 1-3 weeks, as orders are handmade and made to order. Please allow 24-48 hours for a response to messages * See more below! \r\n\r\nHi! Thank you SO much for visiting Let&#39;s Get Decorative! Within this shop, you will discover high quality, custom designed, and hand assembled party decor! Offered here are photo booth props, banners, buttons, cake decor, and much more that are steps above instant downloads, with heart and care going into every detail and piece.\r\n\r\nEnjoy taking a look around the shop, and feel free to message me with any questions, or to start building your custom order today! \r\n\r\n\r\n****LETS GET DECORATIVE IS ON INSTAGRAM, FACEBOOK, and TWITTER! Visit us on Insta @LETSGETDECORATIVE , at www.Facebook.com/LetsGetDecorative, or on Twitter @LGDecorative****\r\n\r\n*****BE SURE TO SUBSCRIBE TO LET&#39;S GET DECORATIVE&#39;S BLOG - CREATING A COLORFUL LIFE @ www.LetsGetDecorative.com*****",
