"login_name": "rachelstahl1",
"accepts_custom_requests": true,
"policy_welcome": "Hi! Thank you SO much for visiting Let&#39;s Get Decorative! Every item listed at the shop can be CUSTOMIZED to the colors and style of your choice! Take a look around, and check back often for new items that are added weekly to the shop!\r\n*********Be sure to like Let&#39;s Get Decorative on Facebook and follow on Instagram @LetsGetDecorative**********\r\n\r\nThis shop&#39;s philosophy is based off just that, getting decorative. I believe that anything can be decorated, and that anything is better when there is a special added touch! \r\nI recently got married and discovered a LOVE for decorating, crafting, and art\r\nTHE MOST IMPORTANT THING IS THAT ALL ITEMS SHOWN CAN BE MADE WITH DIFFERENT COLORS, FABRICS, ETC. MY GOAL IS TO SWITCH IT UP, BE CREATIVE, AND TO MAKE AN ITEM THAT FITS YOU!! IF YOU LIKE SOMETHING SHOWN, BUT WANT IT IN A DIFFERENT COLOR SCHEME, PLEASE MESSAGE ME AND I WOULD LOVE AND WOULD BE SO HAPPY TO DISCUSS IDEAS WITH YOU!!",
