"title": "Engraved Personalized Sipping Whiskey Stones  (set of 3 stones)",
"description": "This listing is for a set of 3 personalized and engraved whiskey stones.  It comes with a small black velvet pouch for storage.  These engraved stones&#39; resulting initials are in a dark black color, per the listing image.\n\nThese sipping stones are dark gray cubes of solid granite that will chill your liquor without diluting it. Unlike ice, sipping stones are odorless and tasteless. Adding sipping stones to your favorite bourbon or scotch will chill the spirit without affecting its taste. Because stone retains its temperature longer than ice, sipping stones provide for a more sustained chill.\n\nWhiskey stones are the perfect gift for the refined connoisseur of spirits.\nThis stone&#39;s edges are slightly rounded as to not scratch the bottom of the glass.\n\nUsually ships in 2-3 business days. Place your order now and in your order notes describe what you want engraved on each stone. Our graphics specialist will have a sample proof ready for you to approve. We do not engrave until we have your approval!\n\nUse:\n-Rinse the stones\n-Put in freezer 4 hours before use\n-Serve 3 stones to chill the drink\n-Let stand for a few minutes and enjoy it\n-Wash the used stones and put back in the freezer\n\nDimensions of each stone:\n0.75 inches wide x 0.75 inches tall x 0.75 inches deep",
