"title": "Whiskey Milk, All Natural Shaving Soap, Beard Soap, Cold Process Soap, Shaving Bar, Soap for Him",
"description": "Men, we know the enemy by many names... it is unrelenting and unyielding... it carries no flag, nor does it adhere to sovereign borders or treaties... This enemy marches on, without pausing to sleep or rest - its strength grows in any climate, be it the deserts of the Sahara or the severe whipping winds of the arctic.  Like a deadly street drug - it goes by many names... &quot;stubble&quot;, &quot;peach-fuzz&quot;, &quot;five o&#39;clock shadow&quot; to name a few.  \n\nFor me, this story became all too personal when one ordinary night, when I was kissing my four year old daughter goodnight, she spoke these words to me, &quot;Daddy, your Whiskeys are tickling me!&quot;.  \n\nIn that terrifying moment, I cursed this seditious enemy and it&#39;s guerilla tactics, and vowed to design a recipe for a bar of shaving soap that was so masterful and crisp, a bar literally bubbling with lather and natural clays to give the swiftest of glides - that no man on this planet would ever again have a desire to &quot;let the enemy&quot; grow another day.  \n\nIt needed to be refreshing and rejuvenating, crisp and clean - yet a bar of action.  It needed to set the stage for any razor, no matter the quality or condition - laying down covering fire in the form of rich conditioning lather.  This recipe my friends, is the birth story of a redeemer, aptly named (by my daughter), &quot;Whiskey Milk&quot; - the newest all natural bar from Lost Elixir and the first bar specially formulated for the combat of daily shaving.\n\n------------\n\nThis recipe is formulated with deep skin conditioning oils including avocado oil, sweet-almond oil, and safflower oil and complemented by a carefully designed blend of orange, lemon, cedarwood, and rosemary essential oils.  This bar was built on a foundation of bentonite clay and organic milk - with subdued and mellow clean tones, understated yet beautifully balanced.  All around, this is really well balanced recipe, and a batch that we&#39;re very proud to now offer.\n\nAll our soaps are made in very small batches using the traditional cold process method of soapmaking. No fragrance oils or artificial colorings or additives are included in any of our Lost Elixir soaps. All natural guaranteed. Prepare to be enchanted...",
